def parse_log(log):
    return log.split()[1:]

def get_template(logs):
    templates = []
    for log in logs:
        tokens = parse_log(log)
        template = ""
        for token in tokens:
            if token == "close":
                template += "{close}"
            elif token == "sent":
                template += "{sent_size}"
            elif token == "received":
                template += "{received_size}"
